-- drop database first just it already exists, else there will be errors
DROP DATABASE IF EXISTS dsa4213;
CREATE DATABASE dsa4213;
USE dsa4213;

-- drop table first if it already exists else we can't use it 
DROP TABLE IF EXISTS candidates CASCADE;

-- create candidate table
create table candidates (
	candidate_name VARCHAR(50),
	candidate_gender VARCHAR(50),
	candidate_experience INT,
	candidate_MostRecenJobTitle VARCHAR(50),
	candidate_education VARCHAR(8),
	candidate_strength VARCHAR(50),
	candidate_MostRescentJobTime DATE,
	candidate_workAttitude DECIMAL(4,2),
	candidate_adaptability DECIMAL(4,2),
	candidate_collaboration DECIMAL(4,2),
	candidate_communication DECIMAL(4,2),
	candidate_workEthics DECIMAL(4,2),
	candidate_leaderShip DECIMAL(4,2),
	position_applied VARCHAR(50),
	region VARCHAR(50),
	department VARCHAR(50)
);
